 you?'=>'måste aktiveras för att importera dess formulär. Vill du att vi ska aktivera det åt dig?','needs to be installed and activated to import its forms. Would you like us to install and activate it for you?'=>'måste installeras och aktiveras för att importera dess formulär. Vill du att vi installerar och aktiverar det åt dig?','Easily collect payments, donations, and online orders without hiring a developer.'=>'Samla enkelt in betalningar, donationer och beställningar online utan att anställa en utvecklare.','Easily create high performance forms with our smart conditional logic.'=>'Skapa enkelt högpresterande formulär med vår smarta villkorliga logik.','Start with pre-built form templates to save even more time.'=>'Börja med förbyggda formulärmallar för att spara ännu mer tid.','Easily create an amazing form in just a few minutes without writing any code.'=>'Skapa enkelt ett fantastiskt formulär på bara några minuter utan att skriva någon kod.','WPForms is both easy to use and extremely powerful. We have tons of helpful features that allow us to give you everything you need from a form builder.'=>'WPForms är både enkel att använda och extremt kraftfull. Vi har massor av användbara funktioner som gör att vi kan ge dig allt du behöver från en formulärbyggare.','WPForms is by far the easiest form plugin to use. My clients love it – it’s one of the few plugins they can use without any training. As a developer I appreciate how fast, modern, clean and extensible it is.'=>'WPForms är den överlägset enklaste tillägget att använda. Mina klienter älskar det – det är ett av få tillägg som de kan använda utan någon utbildning. Som utvecklare uppskattar jag hur snabbt, modernt, stilrent och utbyggbart det är.','Select a WPForms export file.'=>'Välj en exportfil för WPForms.','This item must contain at least one choice.'=>'Detta objekt måste innehålla minst ett val.','You need to <a href="#" class="wpforms-panel-switch" data-panel="setup">setup your form</a> before you can manage these settings.'=>'Du måste <a href="#" class="wpforms-panel-switch" data-panel="setup">konfigurera ditt formulär</a> innan du kan hantera dessa inställningar.','Powerful Form Logic for Building Smart Forms'=>'Kraftfull formulärlogik för att bygga smarta formulär','But when you combine WPForms with Constant Contact, you can nurture your contacts and engage with them even after they leave your website. When you use Constant Contact + WPForms together, you can:'=>'Men när du kombinerar WPForms med Constant Contact kan du främja dina kontakter och engagera dig med dem även efter att de lämnar din webbplats. När du använder Constant Contact + WPForms tillsammans kan du:','Because Constant Contact requires external authentication, you will need to register WPForms with Constant Contact before you can proceed.'=>'Eftersom Constant Contact kräver extern autentisering måste du registrera WPForms hos Constant Contact innan du kan fortsätta.','As a valued WPForms Lite user you receive <strong>50% off</strong>, automatically applied at checkout!'=>'Som en uppskattad användare av WPForms Lite får du <strong>50&nbsp;% rabatt</strong>, tillämpas automatiskt i kassan!','Bonus: WPForms Lite users get <span class="price-20-off">50% off regular price</span>, automatically applied at checkout.'=>'Bonus: Användare av WPForms Lite får <span class="price-20-off">50&nbsp;% rabatt på ordinarie pris</span>, tillämpas automatiskt i kassan.','Are you wondering which form fields you have access to in WPForms and what each field does? WPForms has lots of field types to make creating and filling out forms easy. In this tutorial, we’ll cover all of the fields available in WPForms.'=>'Undrar du vilka formulärfält du har åtkomst till i WPForms och vad varje fält gör? WPForms har många typer av fält som gör det enkelt att skapa och fylla i formulär. I denna handledning kommer vi beskriva alla fält som finns tillgängliga i WPForms.','You must provide a connection nickname.'=>'Du måste ange ett smeknamn för anslutningen.','Check out <a href="%s" target="_blank" rel="noopener noreferrer">our documentation</a> for step-by-step instructions.'=>'Kolla in <a href="%s" target="_blank" rel="noopener noreferrer">vår dokumentation</a> för stegvisa instruktioner.','Payments Made Easy'=>'Betalningar görs enkelt','WPForms is 100% responsive meaning it works on mobile, tablets & desktop.'=>'WPForms är 100&nbsp;% responsivt vilket innebär att det fungerar på mobiler, surfplattor och stationära datorer.','The blank form allows you to create any type of form using our drag & drop builder.'=>'Det tomma formuläret låter dig skapa vilken typ av formulär som helst med hjälp av vår dra och släpp-byggare.','Are you sure you want to delete this choice?'=>'Är du säker på att du vill ta bort detta val?','If you have any questions or issues just <a href="%s" target="_blank" rel="noopener noreferrer">let us know</a>.'=>'Om du har några frågor eller problem, <a href="%s" target="_blank" rel="noopener noreferrer">kontakta oss</a>.','Whoops, you haven\'t created a form yet. Want to <a href="%s">give it a go</a>?'=>'Hoppsan, du har inte skapat något formulär ännu. Vill du <a href="%s">göra ett försök</a>?','WPForms Import'=>'WPForms-import','Limited Marketing Integration'=>'Begränsad marknadsföringsintegration','Entries via Email Only'=>'Endast inlägg via e-post','Form Abandonment'=>'Övergivna formulär','Single Checkbox Field'=>'Fält för enskild kryssruta','Heads up! Don\'t forget to test your form. <a href="%s" target="_blank" rel="noopener noreferrer">Check out our complete guide</a>!'=>'Observera! Glöm inte att testa ditt formulär. <a href="%s" target="_blank" rel="noopener noreferrer">Kolla in vår kompletta guide</a>!','Enter CSS class names for the form submit button. Multiple names should be separated with spaces.'=>'Ange CSS-klassnamn för formulärknappen ”Skicka”. Flera namn ska separeras med mellanslag.','Enter the submit button text you would like the button display while the form submit is processing.'=>'Ange texten för knappen ”Skicka” som du vill att knappen ska visa medan formulärinlämningen bearbetas.','Load Assets Globally'=>'Ladda filer globalt','We made the form creation process extremely intuitive, so you can create a form to start capturing emails within 5 minutes or less.'=>'Vi gjorde processen för att skapa formulär extremt intuitiv, så du kan skapa ett formulär för att börja samla e-post på 5 minuter eller snabbare.','WPForms Makes List Building Easy'=>'WPForms gör det enkelt att bygga listor','Get expert marketing and support'=>'Skaffa expertmarknadsföring och support','With a powerful email marketing service like Constant Contact, you can instantly send out mass notifications and beautifully designed newsletters to engage your subscribers.'=>'Med en kraftfull e-postmarknadsföringstjänst som Constant Contact kan du direkt skicka ut massaviseringar och vackert utformade nyhetsbrev för att engagera dina prenumeranter.','High-Converting Form Builder'=>'Högkonverterande formulärbyggare','Not happy with other WordPress contact form plugins?'=>'Är du inte nöjd med andra WordPress-tillägg för kontaktformulär?','Hide Bulk Add'=>'Dölj lägg till flera samtidigt','States Postal Code'=>'Delstaters postnummer','Due to form changes, conditional logic rules will be removed or updated:'=>'På grund av formulärändringar kommer villkorliga logikregler att tas bort eller uppdateras:','Could not activate the addon. Please activate it on the Plugins page.'=>'Kunde inte aktivera utökningen. Aktivera det från tilläggssidan.','District of Columbia'=>'District of Columbia','Responsive Mobile Friendly'=>'Responsivt mobilvänlig','Hide presets'=>'Dölj förinställningar','No-Conflict Mode'=>'Inget konfliktläge','With Constant Contact + WPForms, growing your list is easy.'=>'Med Constant Contact + WPForms växer din lista lätt.','Get the most out of the <strong>WPForms</strong> plugin &mdash; use it with an active Constant Contact account.'=>'Få ut det mesta av <strong>WPForms</strong>-tillägget &mdash; använd det med ett aktivt Constant Contact-konto.','How to Create GDPR Compliant Forms'=>'Hur man skapar GDPR-kompatibla formulär','Select from our pre-built templates, or create a form from scratch.'=>'Välj från våra förbyggda mallar eller skapa ett formulär från grunden.','Connect your Constant Contact email list.'=>'Anslut din e-postlista för Constant Contact.','Drag and drop any field you want onto your signup form.'=>'Dra och släpp vilket fält du vill till ditt registreringsformulär.','Add your new form to any post, page, or sidebar.'=>'Lägg till nytt formulär till något inlägg, sida eller sidopanel.','That\'s why it\'s crucial to start collecting email addresses and building your list as soon as possible.'=>'Det är därför det är avgörande att börja samla in e-postadresser och bygga upp din lista så snart som möjligt.','It doesn\'t matter what kind of business you run, what kind of website you have, or what industry you are in - you need to start building your email list today.'=>'Det spelar ingen roll vilken typ av företag du driver, vilken typ av webbplats du har eller vilken bransch du är i – du måste börja bygga din e-postlista redan idag.','Carbon Copy'=>'Kopia','Complete Entry Management inside WordPress'=>'Fullständig inläggshantering i WordPress','%d tags were successfully deleted.'=>'%d etiketter togs bort.','It seems you do not have any marketing addons activated. You can head over to the <a href="%s">Addons page</a> to install and activate the addon for your provider.'=>'Det verkar som om du inte har några marknadsföringsutökningar aktiverade. Du kan gå till <a href="%s">sidan med utökningar</a> för att installera och aktivera utökningen för din leverantör.','It seems you do not have any payment addons activated. You can head over to the <a href="%s">Addons page</a> to install and activate the addon for your payment service.'=>'Det verkar som om du inte har några betalningsutökningar aktiverade. Du kan g