nna webbplats lagrar min inlämnade information så att de kan svara på min förfrågan.','Enter text for the form field placeholder.'=>'Ange text för formulärfältets platshållare.','Select the layout for displaying field choices.'=>'Välj layouten för visning av fältval.','Taxonomy'=>'Taxonomi','Show Layouts'=>'Visa layouter','taxonomy'=>'taxonomi','Add New Notification'=>'Lägg till ny avisering','Multiple notifications'=>'Flera aviseringar','Enter the email address to receive form entry notifications. For multiple notifications, separate email addresses with a comma.'=>'Ange e-postadressen för att få aviseringar om formulärinlägg. För flera aviseringar, separera e-postadresser med ett kommatecken.','Marketing provider connection'=>'Anslutning till marknadsföringsleverantör','The default notification settings might be sufficient, but double&#8209;check to be sure.'=>'Standardinställningarna för aviseringar kan vara tillräckliga, men dubbelkontrollera för att vara säker.','Check this option to mark the field required. A form will not submit unless all required fields are provided.'=>'Kryssa i detta alternativ för att markera fältet obligatoriskt. Ett formulär skickas inte om inte alla obligatoriska fält anges.','Your site is running an <strong>insecure version</strong> of PHP that is no longer supported. Please contact your web hosting provider to update your PHP version or switch to a <a href="%s" target="_blank" rel="noopener noreferrer">recommended WordPress hosting company</a>.'=>'Din webbplats kör en <strong>osäker version</strong> av PHP som inte stöds längre. Kontakta ditt webbhotell för att uppdatera din PHP-version eller byt till ett <a href="%s" target="_blank" rel="noopener noreferrer">rekommenderat webbhotell för WordPress</a>.','<strong>Bonus:</strong> WPForms Lite users get <span>50% off</span> regular price, automatically applied at checkout.'=>'<strong>Bonus:</strong> WPForms Lite-användare får <span>50&nbsp;% rabatt</span> på ordinarie pris, tillämpas automatiskt i kassan.','Enter text for the form field label. Field labels are recommended and can be hidden in the Advanced Settings.'=>'Ange text för formulärfältets etikett. Fältetiketter rekommenderas och kan döljas i avancerade inställningar.','<strong>Bonus:</strong> WPForms Lite users get <span class="green">50% off regular price</span>, automatically applied at checkout.'=>'<strong>Bonus:</strong> WPForms Lite-användare får <span class="green">50&nbsp;% rabatt på ordinarie pris</span>, tillämpas automatiskt i kassan.','<h4>Images are not cropped or resized.</h4><p>For best results, they should be the same size and 250x250 pixels or smaller.</p>'=>'<h4>Bilder är inte beskurna eller storleksändrade.</h4><p>För bästa resultat bör de ha samma storlek och 250 × 250 pixlar eller mindre.</p>','Showing the first 20 choices.<br> All %s choices will be displayed when viewing the form.'=>'Visar de första 20 valen.<br> Alla %s val kommer att visas när formuläret visas.','Select the default form field size.'=>'Välj standardformatfältets storlek.','Enter text for the confirmation field placeholder.'=>'Ange text för bekräftelsefältets platshållare.','Create user registration and login forms'=>'Skapa användarregistrerings- och inloggningsformulär','View and Manage Your Form Entries inside WordPress'=>'Visa och hantera dina formulärposter inne i WordPress','View all Form Entries inside the WordPress Dashboard'=>'Visa alla formulärposter inne i WordPress adminpanel','<strong>Note:</strong> The WPForms plugin is disabled on your site until you fix the issue. <a href="%s" target="_blank" rel="noopener noreferrer">Read more for additional information.</a>'=>'<strong>Obs:</strong> Tillägget WPForms är inaktiverat på din webbplats tills du har åtgärdat problemet. <a href="%s" target="_blank" rel="noopener noreferrer">Läs mer för ytterligare information.</a>','Create your first form with our guided setup wizard in less than 5 minutes to experience the WPForms difference.'=>'Skapa ditt